// src/components/Register/index.js
import React, { Component } from 'react';
import { Link, Redirect } from 'react-router-dom';
import Cookies from 'js-cookie';
import Header from '../Header';
import './index.css'; // Assuming you'll create a CSS file for RegisterForm

const websiteLogoInForm = '/WebsiteLogo.png'; 

class RegisterForm extends Component {
  state = {
    username: '',
    email: '',
    password: '',
    confirmPassword: '',
    showSubmitError: false,
    errorMsg: '',
    registrationSuccess: false,
  };

  handleInputChange = (event) => {
    this.setState({ [event.target.name]: event.target.value });
  };

  onSubmitRegisterForm = async (event) => {
    event.preventDefault();
    this.setState({ showSubmitError: false, errorMsg: '' });

    const { username, email, password, confirmPassword } = this.state;

    if (password !== confirmPassword) {
      this.setState({
        showSubmitError: true,
        errorMsg: 'Passwords do not match.',
      });
      return;
    }

    const userDetails = { username, email, password };
    const registerApiUrl = 'http://127.0.0.1:5000/api/register'; // <--- VERIFY THIS: Must be /api/register

    const options = {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(userDetails),
    };

    try {
      const response = await fetch(registerApiUrl, options);
      const data = await response.json();

      if (response.ok) {
        this.setState({ registrationSuccess: true, errorMsg: data.message || 'Registration successful! You can now log in.' });
      } else {
        this.setState({ showSubmitError: true, errorMsg: data.message || 'Registration failed. Please try again.' });
      }
    } catch (error) {
      console.error('Registration network error:', error);
      this.setState({ showSubmitError: true, errorMsg: 'Network error. Could not connect to the server.' });
    }
  };

  render() {
    const { username, email, password, confirmPassword, showSubmitError, errorMsg, registrationSuccess } = this.state;
    const jwtToken = Cookies.get('jwt_token');

    if (jwtToken !== undefined) {
      return <Redirect to="/" />;
    }

    if (registrationSuccess) {
      return (
        <>
          <Header />
          <div className="register-container">
            <div className="registration-success-message">
              <h2>Registration Successful!</h2>
              <p>{errorMsg}</p>
              <Link to="/login" className="login-link-button">Go to Login</Link>
            </div>
          </div>
        </>
      );
    }

    return (
      <>
        <Header />
        <div className="register-container">
          <form className="register-form-container" onSubmit={this.onSubmitRegisterForm}>
            <div className="form-logo-container">
              <img src={websiteLogoInForm} alt="website logo" className="register-website-logo" />
              <span className="logo-text">Garuda AI</span>
            </div>
            <h2>Register for Garuda AI</h2>

            <label className="form-label" htmlFor="registerUsername">
              USERNAME
            </label>
            <input
              className="form-input"
              type="text"
              name="username"
              id="registerUsername"
              value={username}
              onChange={this.handleInputChange}
              placeholder="Choose a username"
              required
            />

            <label className="form-label" htmlFor="registerEmail">
              EMAIL
            </label>
            <input
              className="form-input"
              type="email"
              name="email"
              id="registerEmail"
              value={email}
              onChange={this.handleInputChange}
              placeholder="Enter your email"
              required
            />

            <label className="form-label" htmlFor="registerPassword">
              PASSWORD
            </label>
            <input
              className="form-input"
              type="password"
              name="password"
              id="registerPassword"
              value={password}
              onChange={this.handleInputChange}
              placeholder="Choose a password"
              required
            />

            <label className="form-label" htmlFor="confirmPassword">
              CONFIRM PASSWORD
            </label>
            <input
              className="form-input"
              type="password"
              name="confirmPassword"
              id="confirmPassword"
              value={confirmPassword}
              onChange={this.handleInputChange}
              placeholder="Confirm your password"
              required
            />

            <button className="form-submit-button" type="submit">
              Register
            </button>
            {showSubmitError && <p className="error-message">*{errorMsg}</p>}
            <p className="login-prompt">
              Already have an account? <Link to="/login">Login here</Link>
            </p>
          </form>
        </div>
      </>
    );
  }
}

export default RegisterForm;
